import Foundation
import XCTest

@testable import TechdoseAssignments

class LongestSubstringNoRepeatingCharsTests: XCTestCase {
    
    func testSubarraysDistinctElements_Input1() {
        let targetString = "aabbcc"
        let expectedOutput = 2
        
        let output = LongestSubstringNoRepeatingChars().findLengthOfLongestSubstringWithoutRepeatingChars(
            targetString: targetString
        )
        
        XCTAssertEqual(output, expectedOutput)
    }
    
    func testSubarraysDistinctElements_Input2() {
        let targetString = "abcabcbb"
        let expectedOutput = 3
        
        let output = LongestSubstringNoRepeatingChars().findLengthOfLongestSubstringWithoutRepeatingChars(
            targetString: targetString
        )
        
        XCTAssertEqual(output, expectedOutput)
    }
    
    func testSubarraysDistinctElements_Input3() {
        let targetString = "bbbbb"
        let expectedOutput = 1
        
        let output = LongestSubstringNoRepeatingChars().findLengthOfLongestSubstringWithoutRepeatingChars(
            targetString: targetString
        )
        
        XCTAssertEqual(output, expectedOutput)
    }
    
    func testSubarraysDistinctElements_Input4() {
        let targetString = "pwwkew"
        let expectedOutput = 3
        
        let output = LongestSubstringNoRepeatingChars().findLengthOfLongestSubstringWithoutRepeatingChars(
            targetString: targetString
        )
        
        XCTAssertEqual(output, expectedOutput)
    }
    
